const Header = () => {
  useEffect(() => {
    // Вы можете оставить или изменить этот блок кода в зависимости от вашей логики
    const menuLinks = document.querySelectorAll(`.${styles.menuLink}`);
    menuLinks.forEach((link, index) => {
      link.style.animationDelay = `${1 + index}s`; // Задержка для каждой ссылки
    });
  }, []);
    return (
      <header className={styles.header}>
      <img
        className={styles.headerBackground}
        src="./img/layout/wroclaw1.jpg"
        alt="Wroclaw"
      />
      <p className={styles.headerText}> Wrocław Dom. Twój przewodnik w świecie nieruchomości</p>
    
    </header>
    
    )
  }
  
  export default Header
